import React from 'react';

export default function Contact() {
    return (
        <>
            <section class="contact column justify-center center" data-display="flex" id="contact">
                <h3 class="section-title">reachOut</h3>
                <p>Want to reach out? Whether you want to work together, have some awesome idea and need an awesome coder. Or just want to talk video games and how loot boxes, scalpers, and mining is ruining all the fun, feel free to email me at <a href="mailto:lorenzo.streetsimmons@gmail.com">lorenzo.streetsimmons@gmail.com</a>. </p>
            </section>
            {/* <!--contact row justify-center center contact --> */}
        </>
    )
}
